import { AppBar, Container, Grid, Paper, TextField, Typography } from '@mui/material'
import { borderRadius, Box, color, maxWidth } from '@mui/system'
import { styled } from '@mui/material/styles';
import React from 'react'
import Logo from './Logo.ico'





// Custom Textbox
const CTextField = styled(TextField)({

 
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: '#9B3C21',
      },
      '&:hover fieldset': {
        borderColor: '#9B3C21',
      },
  
    },
  });
  

const Login = () => {
  return (
    <div>
         <Grid container spacing={2} padding={2} >
{/* Logo Column */}
            <Grid item xs={12} sm={12} md = {7} lg={7} zeroMinWidth >

            <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center"
                paddingTop={25}
                >



                 <img src={Logo} width={500} alt='Logo' />
                
            </Grid>

</Grid>

{/* Login Column */}
            <Grid item xs={10} sm={10} md = {5} lg={5} zeroMinWidth >
  

            <Grid container
                direction="column"
                justifyContent="center"
                alignItems="center"
                padding={20}>
                    

                    <Grid
            // CSS coding
                        Container
                        padding={2}
                        style={{
                            backgroundColor:'white',
                            minWidth:'200',
                            borderRadius: 5,
                            border:'3px solid black'}}>
                                <CTextField placeholder='asdasd' fullWidth/>
                        
                    </Grid>
              
                
            </Grid>








                 
            </Grid>
                
            
         
         </Grid>
         
         
    </div>
  )
}

export default Login
